import React, { useEffect, useMemo, useState } from 'react';
import axios from 'axios';
import axiosRetry from 'axios-retry';
import Papa from 'papaparse';
import { Link } from 'react-router-dom';
import './App.css';

// Configura o mecanismo de retentativa para o axios
axiosRetry(axios, { retries: 3, retryDelay: axiosRetry.exponentialDelay });

const Resumo = () => {
  const [previsaoData, setPrevisaoData] = useState([]);
  const [entregaData, setEntregaData] = useState([]);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState(null);

  // Função genérica para buscar dados de uma planilha
  const fetchSheetData = async (url, setData) => {
    try {
      const response = await axios.get(url);
      return new Promise((resolve, reject) => {
        Papa.parse(response.data, {
          header: true,
          skipEmptyLines: true,
          dynamicTyping: true,
          complete: (result) => {
            if (result.data && result.data.length > 0) {
              setData(result.data);
              resolve();
            } else {
              reject(new Error('Dados não encontrados na planilha.'));
            }
          },
          error: (error) => {
            console.error('Erro ao processar CSV:', error);
            reject(error);
          },
        });
      });
    } catch (error) {
      if (!axios.isCancel(error)) {
        throw error;
      }
    }
  };

  // Carregar dados ao montar o componente
  useEffect(() => {
    const loadData = async () => {
      try {
        setError(null);
        setLoading(true);
        await Promise.all([
          fetchSheetData(
            'https://docs.google.com/spreadsheets/d/1dgVHy_i0djzz8ncd1L2zOkzI3qy7YSbT7CvV_BPgXm0/gviz/tq?tqx=out:csv&sheet=Previsao',
            setPrevisaoData
          ),
          fetchSheetData(
            'https://docs.google.com/spreadsheets/d/1dgVHy_i0djzz8ncd1L2zOkzI3qy7YSbT7CvV_BPgXm0/gviz/tq?tqx=out:csv&sheet=Entrega',
            setEntregaData
          ),
        ]);
      } catch (error) {
        console.error('Erro ao carregar dados:', error);
        setError('Erro ao carregar dados. Verifique os links ou tente novamente mais tarde.');
      } finally {
        setLoading(false);
      }
    };
    loadData();
  }, []);

  // Função para calcular o resumo por produto
  const resumoPorProduto = useMemo(() => {
    if (!previsaoData.length || !entregaData.length) return [];

    const resumo = {};

    // Processa os dados de previsão
    previsaoData.forEach((item) => {
      const { Produto, QuantidadePrevista } = item;

      if (!resumo[Produto]) {
        resumo[Produto] = {
          totalPrevisto: 0,
          totalEntregue: 0,
          totalAtrasado: 0,
        };
      }

      resumo[Produto].totalPrevisto += parseFloat(QuantidadePrevista) || 0;
    });

    // Processa os dados de entrega
    entregaData.forEach((item) => {
      const { Produto, QuantidadeEntregue } = item;

      if (!resumo[Produto]) {
        resumo[Produto] = {
          totalPrevisto: 0,
          totalEntregue: 0,
          totalAtrasado: 0,
        };
      }

      resumo[Produto].totalEntregue += parseFloat(QuantidadeEntregue) || 0;
    });

    // Calcula o total atrasado
    Object.keys(resumo).forEach((produto) => {
      resumo[produto].totalAtrasado = Math.max(
        resumo[produto].totalPrevisto - resumo[produto].totalEntregue,
        0
      );
    });

    return Object.keys(resumo).map((produto) => ({
      produto,
      ...resumo[produto],
    }));
  }, [previsaoData, entregaData]);

  return (
    <div className="container">
      <h1>Resumo por Produto</h1>
      <Link to="/">
        <button className="voltar-button">Voltar para Home</button>
      </Link>

      {loading && (
        <div className="loading">
          Carregando... <progress />
        </div>
      )}

      {error && <div className="error">{error}</div>}

      {!loading && !error && (
        <table className="data-table">
          <thead>
            <tr>
              <th>Produto</th>
              <th>Total Previsto</th>
              <th>Total Entregue</th>
              <th>Total Atrasado</th>
            </tr>
          </thead>
          <tbody>
            {resumoPorProduto.map((item, index) => (
              <tr key={index}>
                <td>{item.produto}</td>
                <td>{item.totalPrevisto.toFixed(2)}</td>
                <td>{item.totalEntregue.toFixed(2)}</td>
                <td className={item.totalAtrasado > 0 ? 'faltante-red' : 'faltante-green'}>
                  {item.totalAtrasado.toFixed(2)}
                </td>
              </tr>
            ))}
          </tbody>
        </table>
      )}
    </div>
  );
};

export default Resumo;
